import React from 'react';
import './Button.css';

const theNumbers = [
  { aNumber: '9' },
  { aNumber: '8' },
  { aNumber: '7' },
  { aNumber: '6' },
  { aNumber: '5' },
  { aNumber: '4' },
  { aNumber: '3' },
  { aNumber: '2' },
  { aNumber: '1' },
  { aNumber: '0'}
];


const NumberButton = props => {
  return <div>{props.theNumbers.aNumber}</div>;
};

export default NumberButton;
